import React from 'react';
import './Footer.css';


class Footer extends React.Component{
    constructor(props) {
        super(props);
    }

    render() {
        return(
            <footer className="footer">

                <a href="#home" className="scroll footer__top">
                    <img src="image/drop.png" alt=""/>
                </a>
                <ul className="social">
                    <li><a className="social__icon social__icon_gmail" href=""><img src="image/postenvelope.svg"/></a>
                    </li>
                    <li><a className="social__icon social__icon_skype" href=""><img src="image/skypedrawlogo.svg"/></a>
                    </li>
                    <li><a className="social__icon social__icon_vk" href=""><img src="image/vk.svg"/></a></li>
                </ul>

                <p className="footer__copyright">&copy; 2020. Avinkina M.V.</p>
            </footer>
        )
    }
}

export default Footer;
